public class Solution {
    public static String solution() {
        // Q: 0.5 the students in the band are in the trumpet section. 0.125 the students in the band are in the trombone section. 
        // What fraction of the students in the band are in either the trumpet section or the trombone section?
        double trumpetFraction = 0.5;
        double tromboneFraction = 0.125;
        double totalFraction = trumpetFraction + tromboneFraction;

        // Convert to fraction
        int numerator = (int) (totalFraction * 1000); // Scale to avoid decimals
        int denominator = 1000;

        // Simplify the fraction
        int gcd = gcd(numerator, denominator);
        numerator /= gcd;
        denominator /= gcd;

        String result = numerator + "/" + denominator;
        return result;
    }

    // Helper method to calculate the greatest common divisor
    private static int gcd(int a, int b) {
        while (b != 0) {
            int temp = b;
            b = a % b;
            a = temp;
        }
        return a;
    }

    public static void main(String[] args) {
        System.out.print(solution());
    }
}
